Ridley is a domestic shorthaired tabby and white male, DOB April 2016.&nbsp; He was&nbsp;living with his two&nbsp;brothers in&nbsp;a backyard.&nbsp; He&#39;s very playful with the other cats and is very bonded to his brother Ripley.&nbsp; We would love for them to be adopted together.&nbsp; He is neutered, tested FeLV/FIV negative, vaccinated, neutered, microchipped and ready for a home of his own. There is a discount for adopting multiple cats together.

Ridley and Ripley are currently in foster care so if interested in meeting them please fill out an online application at:&nbsp; http://www.colonycats.org/adoption_app.html &nbsp;

GW

Natalia is a sweet little miss who is a bundle of joy, super smart and loves to learn. She loves to play in the yard or go for long walks. But at the end of the day, she wouldn&rsquo;t mind a curling up with you while you catch up on all your favorite TV shows or Netflix.&nbsp;

&nbsp;

Given her enthusiasm, she would not be suitable for houses with toddlers and young kids. While Natalia loves to play with her fur brother, she would be great with dogs who are her size or bigger than her. She does not share a great rapport with cats, smaller dogs or smaller animals such as rabbits.&nbsp;

&nbsp;

A home with a fenced-in yard and a fur companion to play with would be and ideal home for this lass with long legs. Would your like to make her your own?

&nbsp;

Applications can be found at ihadro.org under forms. Natalia&rsquo;s adoption fee is $175; she is spayed, up to date on vaccines and microchipped.

You meet Ernie, you can&#39;t help but fall in love with him.&nbsp; Ernie was a stray hanging out around one of our volunteer&#39;s neighborhoods.&nbsp; She took him to the vet to be neutered and found out he&#39;s FIV+.&nbsp; Ernie should live in a home so he will have a less stressful life than on the streets.&nbsp;

&nbsp;

Ernie is in a foster home at this time.&nbsp; He gets along with dogs and cats.&nbsp; If you&#39;d like to meet him, fill out our online adoption application at:&nbsp; https://colonycats.org/adoption_app.html . He&#39;s neutered, microchipped, FL negative and up to date on vaccines.&nbsp; DOB&nbsp; Feb 2014

&nbsp;




