Ted is a petite brindle boy with lots of love to give. He loves to just cuddle on the couch with his person and sleep or he loves to&nbsp;be outside going for a walk. He loves kids, and with a slow introduction to dogs, he has done well.&nbsp;


He doesn&#39;t need to be crated during the day so&nbsp;if he is&nbsp;left out with his fur siblings, he does amazing. He hasn&#39;t been cat tested, so we aren&#39;t sure how he would react.&nbsp;

&nbsp;

He is all together a wonderful dog. He&#39;s excelled well with his foster family and neighbors kids.&nbsp;

Sweet Banya is 5 years old and in need of a forever home. She does well with other cats. She sometimes has a bit of a head tilt due to past ear infections.&nbsp;


