Meet Apollo! &hearts;️Apollo is such a sweetheart!! He&rsquo;ll stand on his back legs and wave his paws when he gets excited--cutest thing ever!!&nbsp;He loves attention, other&nbsp;dogs and cats with proper introduction. We believe he will be fine with children but has not been around children since coming to the rescue. He is not a fan of the crate at all and gets very upset if crated, but he&rsquo;s good to leave out.&nbsp;He does alert bark to loud outdoor noises and a doorbell so he may not be the right dog for an apartment/condo.Apollo and his brother, Levi came to the rescue together but they do well separately and do not need to be adopted together.&nbsp;We&nbsp;think they may have been neglected or mistreated but they are doing so much better in their foster home!&nbsp;
