Frosty is a beautiful, petite collie. She had a rough past but has blossomed in her foster home and is looking forward to finding her forever home. She was an outside dog, but quickly learned house manners, is house trained, is a quiet girl, can be trusted in the home without being crated (she will sleep in the crate but doesn&#39;t like to be &quot;put&quot; in it), is good with other dogs in the household&nbsp;and with cats. She loves mealtimes and does a happy trot as she watches her dish come to her spot to eat. Frosty has been fully vetted but she intermittently has digestive issues and will need to remain on a prescription diet, be fed 3-4 times a day and take a daily medication. The prescription food and medication run about $100 per month altogether.

She&#39;s a cautious gal and takes a little time to warm up to new dogs and people so she would enjoy a home with just adults or with older children who are not rambunctious. But, once she get to know you she is happy to cuddle and watch tv on the sofa. a little nudge to your hand lets you know she&#39;d really like some petting. Outside Frosty is happy to be chasing, wrestling and playing with the rest of her dog family. Is Frosty the one for you?

&nbsp;

The adoption fee for Frosty is $300.00

