Doug is a cuddly 8 month old mixed breed puppy, who is ready to find his forever home!
&nbsp;
Doug ended up at a shelter as a very young puppy, emaciated and in horrible condition. He had a mildly lame leg initially, which was diagnosed as a growth plate fracture. After a couple months of crate rest, he was as good as new, and his leg needs no further care. You'd never know he ever had an issue by the way he gallops!&nbsp;
Doug is a recent graduate of our prison training program and now knows his basic commands. He's also crate trained and fully house trained. He's SUPER sweet, loves to be affectionate with his humans, and LOVES to play with other dogs. He's curious about cats, but not aggressive. He's also very good with kids, but is still puppy-like in a lot of ways, so if your kids are experienced with dogs, then they'd be fine.&nbsp;
&nbsp;
If you are interested in adopting Doug, please submit an application on our website, www.prodogsohio.org/adoptables. He's been neutered, vaccinated, microchipped, and his adoption fee is $300.&nbsp;
&nbsp;
Please note, we only schedule meet and greets with approved applicants, as we are all volunteers and do not have a facility for you to visit our dogs. If you have questions about Doug that are not answered in this bio, please email info@prodogsohio.org. Responses to inquiries received via third party sites often go to spam folders and delay our ability to reach you.&nbsp;

Meet Calypso!! This beautiful girl is so sweet! She recently had her last litter of 5 precious babies, was the absolute best mom, and is now available for adoption! She is a little shy with new people, but is so sweet and affectionate once she is comfortable. She has been living in a foster home with other cats and three&nbsp;Great Danes. While the kittens were with her, she had shown some dislike for other cats, but we believe once she is settled in and no longer needing to protect them, she should adjust fairly quickly. She does however like the dogs, even the feisty puppy!! Calypso would do best in a home without small children just because she is a little shy, but would do great with older kids, dogs, and potentially cats. This girl just wants love and attention, if you think that&#39;s you, please fill out an application on this sweet girl!!! Calypso&nbsp;
is spayed, microchipped, FL/FIV negative and up to date on vaccines. (DOB 6/2014)

