It&rsquo;s tough to pick an example of when Stewart is at his cutest but it&rsquo;s probably how, after a week of getting to know his foster family, he started getting the zoomies when he sees them in the morning, or his tiny tail wags when you call him Stu-Stu. 
Stu, as he's affectionately known, doesn&rsquo;t have any aggressive tendencies at all, to the degree that he doesn&rsquo;t like tug and fetch is still a bit scary for him, but he is still scared of a lot of things and needs gentle repetition to work through those fears. He loves running around and (when he gets very comfortable) will do an impressive juke and spin move to show he&rsquo;s only pretending to be scared. 
Stu is fully house trained, kennel trained, and knows his basic commands. He&rsquo;s a quick learner and really lights up doing tricks, and would do great in a home that kept up his training. He&rsquo;s exceptionally curious, which is a great sign for overcoming fears because he&rsquo;s willing to try hard things (the first time he went in a car he was panicked blind, and now he&rsquo;ll get himself in and out of the car).
Stu is a really exceptionally wonderful dog, but because he&rsquo;s still learning that people can be kind, he needs a home with people who are chill if he doesn&rsquo;t do something for them immediately. He cannot go to a home where he is only one person&rsquo;s pet. He needs a home where everyone in the family will pet him gently whenever they get close, speak nicely to him, and use positive reinforcement. In that home, Stu will quickly come out of his shell and be an absolutely amazing member of the family. Stu would be happiest in a home with a confident, non-aggressive dog to imitate and run around with. He can go to a home with kids of any age or cats, but only if the adults in the home are good about setting boundaries and teaching their kids to be gentle.
If you are interested in adopting Stewart, please submit an application on our website, www.prodogsohio.org/adoptables. His adoption fee is $300 and a fenced yard is non-negotiable for Stewart.&nbsp;
