Ginger is a beautiful, friendly collie who is a Velcro dog around her people both inside and out, always making sure she knows where her family is.&nbsp; She is eager to please and affectionate and when praised and petted she wiggles her whole body to let you know how much she&rsquo;s enjoying it.&nbsp; She is happiest when she is as close to you as she can get- at your feet, next to you or even on your lap!&nbsp; Ginger understands the commands Sit, Come, Shake, and knows her name.&nbsp; Outside running in a fenced in yard is a joy for her.&nbsp; She is easy going while being brushed and when riding in the car and is quiet. She is frightened by unfamiliar and loud noises and might bolt so keeping her inside during fireworks or thunderstorms will keep her safe.&nbsp; Steps were new to her and this smart girl quickly learned to go up and down them at her foster home.&nbsp; She is crate trained, does cry a bit at bedtime only because she wants to be where the family is, then quickly settles down for the night.&nbsp;&nbsp; She loves her toys but is possessive of them so needs a home where she can be the only dog and with children who are older and dog savvy.&nbsp; Her favorite thing in the world is to be with the people she loves and this sweet girl is looking for her forever family to love with all of her heart.
The adoption fee for Ginger is $300.00.

Welcome Screech!&nbsp;
&nbsp;
Screech is a 1 year old mixed breed, whose look is just as unique as his personality! He's been hanging out at the shelter for a few months and they thought he'd be a better candidate for adoption if he moved to a foster home. They were spot on and he's currently thriving in our foster home!&nbsp;
&nbsp;
This hunky guy weighs about 45 lbs and is full grown. He knows basic commands: sit, down, stay, and leave it. Screech loves to take walks and play outside. He is potty trained and will let you know when he needs to go out, and is also crate trained.
&nbsp;
Screech is energetic and jumps when he gets excited so he would do best in a home with older children. Screech also will chew on toys/clothes/shoes if he has access to them, so crating is non-negotiable until he's past his early years. He redirects well and will &ldquo;leave it&rdquo; when told. He may not do well with cats because he enjoys chasing them, but he hasn't hurt one.&nbsp;
&nbsp;
Screech is food motivated and will need a home that will continue to work on manners with him.&nbsp;He is eligible to go to our prison program when we have an opening in the future, which an adopter can take advantage of after adoption.&nbsp;
&nbsp;
If you are interested in adopting Screech, please submit an application on our website, www.prodogsohio.org/adoptables. His adoption fee is $300.&nbsp;
&nbsp;
Please note we only schedule meet and greets with approved adopters, so you must have an approved application on file to meet Screech. We do not have a facility where all of our dogs are housed; all meet and greets are scheduled with foster families.&nbsp;
&nbsp;
