Qtip&rsquo;s adoption donation is $400 and he is being fostered in Central Ohio.&nbsp; He has been neutered, microchipped, received his rabies, distemper/parvo, bivalent canine influenza, and Bordetella vaccines, tested negative for heartworms and started on heartworm/flea/tick prevention.&nbsp;He has also had a dental cleaning.

Qtip came into rescue when his previous owner could no longer care for him and he was re-homed but his activity level was too much for the resident dog.&nbsp;&nbsp;

Qtip definitely loves to play with other dogs similar to his size. He sometimes gets a bit greedy when it comes to getting pets from his people but he just loves his humans! Qtip loves to use his little voice to let you know if someone is at the door, or across the street on a walk but he is very friendly when meeting new friends (human or canine). Qtip hasn&#39;t been kid or cat tested.&nbsp;

Qtip is definitely a lap dog. He loves cuddling at night in bed with his people, on the couch, really anywhere his people are he likes to be. He hasn&#39;t been trained much on a leash but he loves to go for walks to sniff. He knows to sit and his name, but he would like his new family to teach him more tricks as long as they provide yummy treats. Qtip is potty trained and crate trained and will bark at you if he needs to use the potty.&nbsp;

Qtip would be great in an only pup home or a home with other dogs. Once he learns the dog dynamic he adjusts pretty easily to any home situation. Qtip is such a sweet, loving, happy dog and is ready for his forever family to love him for the rest of his life!&nbsp;

Meet Kona. She is a six year old, 77 pound german shepherd mix. She was seen being pushed out of a car in a rural county. When questioned the family in the car said &quot;we don&#39;t want her anymore and didn&#39;t know what else to do&quot;. Although fearful at first she quickly warms up and wags her tail. Kona is house trained and crate trained. She has been left out of her crate in her foster home and does well. Okay with cats and other dogs. She is a big girl and sometimes forgets her size and gets bouncy with small dogs. This scares one of the small dogs in her foster home. The other small dog teases her by ducking under the furniture. Kona knows sit and doesn&#39;t jump on people. Her adopter will need experience with big dogs and especially German Shepherds.&nbsp; She is protective of her foster family and has a bark that people notice.

